import React from "react";
import styles from "./Close.module.css";

const Close = props => {
  let closeStyles = props.optionSelected
    ? styles.SubmitButton
    : styles.CloseButton;
  return (
    <span className={closeStyles} onClick={props.openHandler}>
      {props.children}
    </span>
  );
};

export default Close;
